import { Link } from "react-router-dom";
import logo from "./logo.png";
import { Navbar, Nav, Container, Row, Col } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import "./mySass.scss";

const navbar = () => {
  return (
    // <nav className="navbar">
