    <div>
      <Container>
        <Navbar id="mainBar" bg="myLight" expand="md" collapseOnSelect>
          <Navbar.Brand>
            <img id="mainLogo" src={logo} width="60px"></img>
          </Navbar.Brand>

          <div id="logo-text">
            <h2>NETFLIX & CHILL</h2>
          </div>

          <Navbar.Toggle />
          <Navbar.Collapse id="coll">
            <Nav id="barItems">
              <Nav.Link to="/movies/1">Home</Nav.Link>
              <Nav.Link to="/contact">Contact</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      </Container>
    </div>
  );
};

export default navbar;
